const theme = {
  colors: {
    background: '#22577A',     // Dark Background
    text: '#FFFFFF',           // White Text
    primary: '#FFC857',        // Rich Gold (primary)
    secondary: '#5BC0DE',      // Slate Blue (secondary)
    accent: '#4CAF50',         // Emerald Green (accent)
    highlight: '#3E767B', // Muted Teal (highlight)
  },    // Muted Teal (highlight)
};


export default theme;
